import React from 'react';
import './Contact.scss';

const Contact = () => {
  const gridItems = [
    {
      title: 'Horijon',
      blocks: 'Check out our page on Horijon.io',
      date: 'horijon.io/horijon',
      link: '#reading'
    },
    {
      title: 'Instagram',
      blocks: 'Check out our page on @horijon.io',
      date: 'horijon.io/horijon',
      link: '#reading'
    },
    {
      title: 'Youtube',
      blocks: 'Check out our page on Youtube',
      date: 'horijon.io/horijon',
      link: '#reading'
    },
    {
      title: 'Horijon',
      blocks: 'Check out our page on Horijon.io',
      date: 'horijon.io/horijon',
      link: '#reading'
    }
  ];

  return (
    <section id="contact" className="contact">
      <div className="contact__grid">
        {gridItems.map((item, index) => (
          <a 
            key={index} 
            href={item.link}
            className="contact__grid-item"
          >
            <div className="content">
              <h3>{item.title}</h3>
              <p>{item.blocks} â€¢ {item.date}</p>
            </div>
          </a>
        ))}
      </div>
    </section>
  );
};

export default Contact;
